import json
import zlib
from base64 import b64decode

from hssp.utils.crypto import decrypt_aes_256_ecb_pad7

def main():
    text = ""
    key = bytes.fromhex("36393039314130433937384438303630")
    data = b64decode(text)
    data = decrypt_aes_256_ecb_pad7(data, key=key)
    decompressed = zlib.decompress(data, wbits=31)
    data = decompressed.decode('utf-8')
    data = json.loads(data)
    print(data)



if __name__ == '__main__':
    main()
